    true,nt"url": null,nt"notes": "This dataset contains Decisions and Orders
    originating from EPAs Office of Administrative Law Judges (OALJ), which is an independent
    office in the Office of the Administrator of the EPA. The Administrative Law Judges
    conduct hearings and render decisions in proceedings between the EPA and persons,
    businesses, government entities, and other organizations which are or are alleged
    to be regulated under environmental laws. Administrative Law Judges preside in enforcement
    and permit proceedings in accordance with the Administrative Procedure Act. Most
    enforcement actions initiated by the EPA are for the assessment of civil penalties.
    The Decisions and Orders are organized into three categories: (1) alphabetical listing
    by the respondent involved, (2) reverse chronological listing by date, and (3) Decisions
    and Orders under FIFRA Section 6. This dataset includes Decisions and Orders dating
    back to 1989 in the Reverse Chronological list, Decisions and Orders dating back
    to 1997 in the Alphabetical list, and a few Decisions and Orders dating back to
    1974 under FIFRA Section 6.",nt"license_title": "Other License Specified",nt"extras":
